import React from 'react'
import './Fooditem.css'
import { assets } from '../assets/assets'
import AOS from 'aos';
import 'aos/dist/aos.css';
import { useEffect } from 'react';


const Fooditem = ({ id, name, price, description, image }) => {
    useEffect(() => {
        AOS.init({ duration: 1000 });
    }, []);
    return (




        <div className="container mt-5">
            <div className="row">
                
                    <div className="  col-lg-4 col-md-6 col-sm-12 pizzacard" data-aos="fade-up">
                        <div className='m-3 rounded p-3'>
                            <div className='d-flex justify-content-center align-items-center' data-aos="zoom-in">
                                <div className='k1  m3 rounded p-3'>
                                    <div>
                                        <img className='food-iem-img' src={image} />

                                        <p>{name}</p>
                                        <img src={assets.rating_starts} />


                                        <p className='des'>{description}</p>
                                        <p className='pri'>{price}</p>


                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                ))}
            </div>

        </div>
    )
}

export default Fooditem
